function Hero() {
  return (
    <nav className="sticky top-0 z-50 w-full bg-black text-sea-green-500 shadow-lg h-48">
      <div className="max-w-7xl mx-auto px-8">
        <div className="flex items-center justify-between h-full">
          {/* Logo or Brand Name */}
          <div className="flex-shrink-0">
            <span className="text-4xl font-bold text-transparent bg-clip-text bg-gradient-to-r from-sea-green-400 to-sea-green-600">
              FocusWin
            </span>
          </div>

          {/* Navigation Links */}
          <div className="flex space-x-8">
            <a
              href="#home"
              className="text-3xl font-semibold text-sea-green-500 hover:text-sea-green-400 transition duration-300"
              onMouseEnter={(e) => (e.target.style.color = '#1fa67a')}
              onMouseLeave={(e) => (e.target.style.color = '#1a8c5e')}
            >
              Home
            </a>
            <a
              href="#features"
              className="text-3xl font-semibold text-sea-green-500 hover:text-sea-green-400 transition duration-300"
              onMouseEnter={(e) => (e.target.style.color = '#1fa67a')}
              onMouseLeave={(e) => (e.target.style.color = '#1a8c5e')}
            >
              Features
            </a>
            <a
              href="#login"
              className="text-3xl font-semibold text-sea-green-500 hover:text-sea-green-400 transition duration-300"
              onMouseEnter={(e) => (e.target.style.color = '#1fa67a')}
              onMouseLeave={(e) => (e.target.style.color = '#1a8c5e')}
            >
              Login
            </a>
            <a
              href="#signin"
              className="text-3xl font-semibold text-sea-green-500 hover:text-sea-green-400 transition duration-300"
              onMouseEnter={(e) => (e.target.style.color = '#1fa67a')}
              onMouseLeave={(e) => (e.target.style.color = '#1a8c5e')}
            >
              Signin
            </a>
          </div>
        </div>
      </div>
    </nav>
  );
}

export default Hero;
